import react,{useEffect,useState} from 'react';
import { BiLeftTopArrowCircle } from 'react-icons/bi';
import {CgDarkMode} from 'react-icons/cg';





function App() {

    const [isOpen, setIsOpen] = useState(false);



  return (
    <div className="MainPageButton"  onClick={()=>setIsOpen(!isOpen)}>
    <BiLeftTopArrowCircle className="Goto_top" onClick={()=>{
      window.scrollTo(window.screenY+window.innerHeight,0)
    }}></BiLeftTopArrowCircle>
    <CgDarkMode className="DarkMode"></CgDarkMode>
    </div>
  );
}

export default App;
